import React, { useState, useEffect } from 'react';
import { Link, useNavigate, useLocation, useParams } from 'react-router-dom';

function Add() {
    const navigate = useNavigate();
    // const location = useLocation();
    const [client, setClient] = useState({});

    // useEffect(() => {
    //     setProduct(location.state);
    //     getCategories();
    // }, []);

    const setInputs = (event) => {
        const temp = client;
        temp[event.target.id] = event.target.value;
        console.log(temp);
        setClient(temp);
    }

    const click = async () => {
        // const data = 
        await fetch(`http://localhost:3090/clients/add`, {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
            },
            body: JSON.stringify({ client: client })
        });
        navigate(-1);
    }

    return (
        <div className='container'>
            <h3 onClick={() => { navigate(-1); }}>X</h3>
            <div>
                <h1 className='form_title'>Add Client</h1>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='firstName' onBlur={setInputs} placeholder='First Name' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='lastName' onBlur={setInputs} placeholder='Last Name' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='clientId' onBlur={setInputs} placeholder='Id' />
                </div>
                <div className='form_input-group'>
                    <span>Date Of Birth </span>
                    <input type='date' className='form_input' id='dateOfBirth' onBlur={setInputs} placeholder='Date Of Birth' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='telphone' onBlur={setInputs} placeholder='Telephone' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='phone' onBlur={setInputs} placeholder='Phone' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='telephone' onBlur={setInputs} placeholder='Telephone' />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='vaccinsDate' onBlur={setInputs} placeholder={client.vaccinsDate} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='vaccineManufacturer' onBlur={setInputs} placeholder={client.vaccineManufacturer} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='positiveResult' onBlur={setInputs} placeholder={client.positiveResult} />
                </div>
                <div className='form_input-group'>
                    <input type='text' className='form_input' id='recoveryDate' onBlur={setInputs} placeholder={client.recoveryDate} />
                </div>

                <button className='form_button' type='submit' onClick={click}>{act}</button>
            </div>
        </div>
    )
}

export default Add;
